import { useParams } from "react-router-dom"
import { useState, useEffect } from "react"

function CafePerfil() {
   const {id} = useParams()

   const [cafe, setCafe] = useState([])

   useEffect(() => {
      axios.get(`http://localhost:8000/api/db/catalogo/${id}`).
      then(response => {
         setCafe(response.data)
      }).catch(err => {});
   })

   return(
      <div>
         teste
      </div>
   )
}

export default CafePerfil
